create database videonoleggio;

USE videonoleggio;


CREATE TABLE negozio(
	id_negozio INTEGER PRIMARY KEY, 
	nome VARCHAR(255),
	citta VARCHAR(255)
); 

CREATE TABLE film(
	id_film INTEGER PRIMARY KEY, 
	nome VARCHAR(255),
	anno INTEGER,
	regista VARCHAR(255)
);  

CREATE TABLE cliente(
	id_cliente INTEGER PRIMARY KEY, 
	cognome VARCHAR(255), 
	nome VARCHAR(255), 
	anno_nascita INTEGER,
	citta_residenza VARCHAR(255), 
	data_registrazione DATE
); 

CREATE TABLE noleggio(
	id_noleggio INTEGER PRIMARY KEY, 
	id_negozio INTEGER, 
	id_cliente INTEGER, 
	id_film INTEGER, 
	data_noleggio DATE, 
	prezzo INTEGER,
	FOREIGN KEY (id_negozio) REFERENCES negozio(id_negozio),
	FOREIGN KEY (id_cliente) REFERENCES cliente(id_cliente),
	FOREIGN KEY (id_film) REFERENCES film(id_film)
); 



